import iconOne from "./icone1.png";
import iconTwo from "./icone2.png";
import iconThree from "./icone3.png";
import iconFor from "./icone4.png";
import iconFive from "./icone5.png";
import lixeira from "./lixeira.svg";

const icones = {
  categorias: [
    {image: iconOne, category: "Casacos"}, 
    {image: iconTwo, category: "Camisa"}, 
    {image: iconThree}, 
    {image: iconFor}, 
    {image: iconFive, category: "Partes de Baixo"}
  ],
  lixeira,
};

export default icones;
